-- Table structure for exam_topic
-- ----------------------------
DROP TABLE IF EXISTS `exam_topic`;
CREATE TABLE `exam_topic` (
  `id` bigint(20) NOT NULL COMMENT '考试题目详细信息的编号',
  `resultId` bigint(20) NOT NULL COMMENT '考试成绩的编号,外键关联 result 成绩表的 id',
  `topicId` bigint(20) NOT NULL COMMENT '面试题目的编号,外键关联 topic 面试题目表的 id',
  `topicScore` double NOT NULL COMMENT '当前题目的分数(默认值为 0)',
