-- ----------------------------
-- Table structure for feedback
-- ----------------------------
DROP TABLE IF EXISTS `feedback`;
CREATE TABLE `feedback` (
  `id` bigint(20) NOT NULL COMMENT '用户反馈编号',
  `userLoginId` bigint(20) NOT NULL COMMENT '当前用户登录编号,外键关联 user_login 表的 id',
  `content` text NOT NULL COMMENT '反馈内容',
  `feedbackTime` date NOT NULL COMMENT '反馈时间(默认为当前时间)',
  `haveSolve` tinyint(1) NOT NULL COMMENT '是否已经处理过了',
  `adminId` bigint(20) DEFAULT NULL COMMENT '进行处理的管理员编号(可以为空,因为管理员有可能没有进行处理),外键关联 admin 管理员表的 id',
  `solveMethod` varchar(200) DEFAULT NULL COMMENT '处理方法(可以为空,因为管理员有可能没有进行处理)',
  `solveTime` date DEFAULT NULL COMMENT '处理的时间(可以为空,因为管理员有可能没有进行处理)',
  PRIMARY KEY (`id`),
  KEY `userLoginId` (`userLoginId`),
  KEY `adminId` (`adminId`),
  CONSTRAINT `feedback_ibfk_1` FOREIGN KEY (`userLoginId`) REFERENCES `user_login` (`id`),
  CONSTRAINT `feedback_ibfk_2` FOREIGN KEY (`adminId`) REFERENCES `admin` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户反馈信息表';

