  CONSTRAINT `result_ibfk_1` FOREIGN KEY (`examId`) REFERENCES `exam` (`id`),
  CONSTRAINT `result_ibfk_2` FOREIGN KEY (`userLoginId`) REFERENCES `user_login` (`id`)
